func (c *current) onVarStatement1(name, typ, exp any) (any, error) {
	if typ == nil && exp == nil {
		return nil, fmt.Errorf("var statement must have a type or an expression")
	}

	return &VarStatement{
		Name: name.(Identifier),
		Expr: maybePtr[Expr](exp),
		Type: maybePtr[Type](typ),
	}, nil
}

